import styled from 'styled-components'

export const ContainerMoviePrincipal = styled.div`
margin-left: 10px;
display: inline;
overflow-x: hidden;
width: 9999px;
`

export const ContainerMovie = styled.div`
border: 1px solid blue;
display: inline-block;

img {
    width: 150px;
}
`
